import React from 'react';
import Navbar from '../../Shared/Navbar';
import './UserHome.css'
const UserHome = () => {
    return (
        <div className='row'>
            <div className="col-md-3">
                <Navbar/>
            </div>
            <div className="col-md-9 background">

            </div>
        </div>
    );
};

export default UserHome;
